(60, 'item/product=60', 'images/ecsettartohosszu.png', 'h.e2.jpg,h.e1.jpg,ecsettartohosszu.png,hosszuecsettarto.png,hosszuecsettarto2.png', 1490, '40x100x9', 'Hosszú Ecsettartó', 'Praktikus', 'Festés közbeni ecsettartó a munka megkönnyítése érdekében. Tökéletes helyet ad az éppen nem használt ecseteknek és megakadályozza az festék asztalra való lecsöpögését is. Egyszerre maximum 9 ecset tartására képes.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>50mm x 65mm x 5mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by-sa/3.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:3862469\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket <a href=\"https://www.thingiverse.com/kerhac/about\" class=\"bld\">kerhac</a> készítette. &#169; <!--DATE--> kerhac. Minden jog fenntartva.', 'Paintbrush_Holder_-_long', 57, 0, '2020-06-00 00:00:00');
