(74, 'item/product=74', 'images/bittarto.png', '3cs2.jpg,3cs1.jpg,3cs3.jpg,3cs4.jpg,3cs5.jpg,b_t4.jpg,b_t1.jpg,b_t2.jpg,b_t3.jpg,csav_2.png', 1590, '20x20x30', '1/4\" Bittartó (6db)', 'Praktikus', '1/4\" bittartó. Ideális választás lehet szakembereknek vagy hobbi barkácsolóknak. A termék alkalmas a bármilyen 1/4\" méretű szabvány szerinti bit tárolására. A csomag tartalma 6db bittartó.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>20mm x 20mm x 30mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by-sa/3.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:1334432\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket <a href=\"https://www.thingiverse.com/terminus/designs\" class=\"bld\">Terminus</a> készítette. &#169; <!--DATE--> Terminus. Minden jog fenntartva.', 'Hex_Handle_rotated_for_printing', 71, 0, '2020-06-00 00:00:00'),
(75, 'item/product=75', 'images/masktarto.png', 'sz_t1.jpg,sz_t2.jpg,ak_ma1.png', 1190, '75x28x15 ', 'COVID-19 Szájmaszk Pánt', 'Praktikus', 'Szájmaszk pánt a COVID-19 járvány idejére. Hasznos termék lehet minden egészségügyi dolgozó vagy átlagember számára. A termék leveszi a terhet a használó füléről, így kényelmessé teszi a hosszabb ideig tartó maszkviselést is. Több fokozatban állítható a pánt, így szinte minden nagyságú és formájú fejhez illik.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>75mm x 28mm x 15mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by/4.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:4249113\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket <a href=\"https://www.thingiverse.com/suraky/designs\" class=\"bld\">Ken Lord</a> készítette. &#169; <!--DATE--> Ken Lord. Minden jog fenntartva.', 'Surgical_Mask_Strap_Remix', 2, 1, '2020-06-00 00:00:00'),
(76, 'item/product=76', 'images/zacskocsipesz.png', 'cs_1.jpg,cs_2.jpg,csip_2.png', 1090, '90x20x7 ', 'Tasak Csipesz', 'Praktikus', 'Egyszerűen használható tasak csipesz. Kiválóan alkalmas szinte bármilyen task vagy zacskó összefogására kinyitás után. Masszív és stabil tervezésének köszönhetően vastagabb tasakokat vagy egyszerre akár egyszerre több zacskót is össze tud fogni.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>90mm x 20mm x 7mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by/4.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:2335157\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket <a href=\"https://www.thingiverse.com/gordoninnovations/designs\" class=\"bld\">Tom Gordon</a> készítette. &#169; <!--DATE--> Tom Gordon. Minden jog fenntartva.', 'bag_clip', 73, 0, '2020-06-00 00:00:00'),
(77, 'item/product=77', 'images/ev_pa1.png', 'evpaha.jpg,e_t0.jpg,e_t1.jpg,e_t2.jpg,ev_pa2.png', 990, '45x45x112', 'Evőpálcika Összefogó', 'Praktikus', 'Nem ázsiai emberek számára nagy nehézséget okozhat az evőpálcikával való evés. Az evőpálcika összefogó lehetővé teszi, hogy bármilyen előzőleges gyakorlat nélkül tudjunk evőpálcikával enni. Az evőpálcikákat a két vájatba kell befogatni és ezután a tetejénél összenyomni, hogy felvegyük a falatot. Az anyag minimális rugalmasságának köszönhetően a pálcikák elengedés után visszaállnak eredeti pozíciójukba.<br><br>\r\n\r\nTulajdonságok:\r\n<ul class=\"dul\">\r\n<li>3DJAKE ecoPLA filament (környezetbarát, biológiai úton lebomló anyag)</li>\r\n<li>Környezetbarát csomagolás</li>\r\n<li>45mm x 45mm x 112mm</li>\r\n</ul>\r\n\r\nA termék szabad <a href=\"https://creativecommons.org/licenses/by/4.0/\" class=\"bld\">licensszel</a>\r\nvan forgalomban, így te is <a href=\"https://www.thingiverse.com/thing:5923\" class=\"bld\">megtekintheted</a>\r\nés kedved szerint módosíthatod.\r\nAbban az esetben, ha a szeretnéd a saját modelledet kinyomtatni használd a\r\n<a href=\"/print\" class=\"bld\">bérnyomtatás</a> funkciót.<br><br>\r\n\r\nA terméket a <a href=\"https://www.thingiverse.com/zydac/designs\" class=\"bld\">Zydac</a> készítette. &#169; <!--DATE--> Zydac. Minden jog fenntartva.', 'ChopstickTrainer', 74, 1, '2020-06-00 00:00:00');

